description:
Be Careful What You Wish ForPeter (Joey Ray) is a small time crook betrayed and killed by his sexy female partner in crime (Alexa Rae). Upon entering Heaven, he finds out he can have all the women he asks for, all the power he wants, and all the money he needs. But there is a fine line between Heaven and Hell and it's called South Of Eden.In this titillating sex comedy, Robby D. examines the virtues of balance where the scales of pleasure tilt unevenly in one direction.Is too much of a good thing Heaven?

